import React, {useState} from "react";
import  './FormExpenses.css';

const FormE = ()=>{
   const Myfu = (event)=>{

    const [myInput, setInput] = useState({
        setmytitle : '',
        setamount : '',
        setdate : ''

    })

    setInput((preState) =>{
        return {...preState, setmytitle:event.target.value}
    })
    }

    return <form>
            <div className="new-expense__controls">
                <div className="new-expense__control">
                    <label>Title</label>
                    <input type="text" onChange={Myfu}/>
                </div>
                    <label>Amount</label>
                    <input type="number" min="0.01"  step="0.01" onChange={Myfu} />
                <div className="new-expense__control">
                    <label>Date</label>
                    <input type="date" min="2018-05-21" max= "2022-11-14" onChange={Myfu} />
                </div>

                <div className="new-expense__control">
                    <button type="submit">Submit</button>
                </div>
            </div>
        </form>
    }
export default FormE;
